	if not CODCASTER_CONDITIONS.IsCDLClient() then
		ACTIONS.SetFont( self.TeamName, FONTS.PrimaryBold )
		ACTIONS.SetFontSize( self.TeamName, 36 )
		ACTIONS.SetFontLeading( self.TeamName, 2 )
	end
	f0_local0( self, f1_local1, controller )
	return self
end

